import React, { useState } from "react";
import axios from "axios";
import { useParams } from "react-router-dom";

function CreateResume() {
  const [inputs, setInputs] = useState({
    name: "",
    email: "",
    number: "",
    DOB: "",
    gender: "",
    religion: "",
    nationality: "",
    maritalStatus: "",
    hobbies: "",
    language: "",
    address: "",
    experiences: [],
    education: [],
    skills: [],
  });

  const handleChange = (e) => {
    setInputs((prevState) => ({
      ...prevState,
      [e.target.name]: e.target.value,
    }));
  };

  const handleNestedChange = (e, section) => {
    const { name, value } = e.target;
    setInputs((prevState) => ({
      ...prevState,
      [section]: {
        ...prevState[section],
        [name]: value,
      },
    }));
  };

  const handleAddExperience = () => {
    setInputs((prevState) => ({
      ...prevState,
      experiences: [...prevState.experiences, prevState.experienceInputs],
      experienceInputs: {},
    }));
  };

  const handleAddEducation = () => {
    setInputs((prevState) => ({
      ...prevState,
      education: [...prevState.education, prevState.educationInputs],
      educationInputs: {},
    }));
  };

  const handleAddSkill = () => {
    setInputs((prevState) => ({
      ...prevState,
      skills: [...prevState.skills, prevState.skillsInputs],
      skillsInputs: {},
    }));
  };

  const handleSubmit = async (e) => {
    /* eslint-disable */console.log(...oo_oo(`1805431794_66_4_66_24_4`,"enter"));
    e.preventDefault();

