                <label className="form-label">Skill Name</label>
                <input
                  type="text"
                  placeholder="JavaScript"
                  className="form-control"
                  value={inputs.skillsInputs?.name || ""}
                  onChange={(e) => handleNestedChange(e, "skillsInputs")}
