              </div>
              <div className="col-md-6">
                <label className="form-label">Proficiency</label>
                <select
                  className="form-select"
                  value={inputs.skillsInputs?.proficiency || ""}
                  onChange={(e) => handleNestedChange(e, "skillsInputs")}
